    align-items: center;
  	padding: 0 60px !important;
}

.gw-go-col-wrap .gw-go-col.gw-go-auxin_hosting_start .gw-go-body>li {
	padding: 20px 50px !important;
}

.gw-go-auxin_hosting_normal .aux-gw-go-header {
	background: #ECECEC;
	padding: 38px 0px;
}

.gw-go-auxin_hosting_normal .aux-gw-go-header-top {
	background: transparent;
  	color: #161616;
  	padding: 0 !important;
  	margin-bottom: 7px;
}

.auxin_hosting_start:nth-child(2n+1) .aux-gw-go-header {
	background: #F3F3F3;
}

.gw-go-auxin_hosting_normal .aux-gw-go-header-price {
	background: transparent;
  padding: 0 !important;
}

.gw-go-auxin_hosting_normal .aux-gw-go-header-price span[data-id="price"] {
	font-weight: 300;
  	display: inline-block;
}

.gw-go-auxin_hosting_normal .aux-gw-go-header-price .payment {
	display: inline-block;
  	font-weight: 300 !important;
  	color: rgba(22, 22, 22, 0.7);
}

.gw-go-auxin_hosting_normal .aux-gw-go-header-price span[data-id="price"]  span[data-id="currency"] {
  	font-size: 43px;
}

.gw-go-col-wrap .gw-go-col.gw-go-auxin_hosting_normal .gw-go-body>li {
  	padding: 20px 10px !important;
}

.gw-go-col:before {
